import {NOMBRETIENDA} from "../CONST"

import "./Carrusel.css";

function Carrusel() {
	
	const data = {
		imagen: "https://cdn.shopify.com/s/files/1/2789/5142/files/Group_24_44cc67a2-d1be-43d0-9176-3aa3185af93f_1920x.jpg?v=1672884098",
	}
	
	return (
		<section id="carrusel">
			<img src={data.imagen} alt={NOMBRETIENDA} />
		</section>
	)
}
export default Carrusel;
